import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import { makeStyles } from "@material-ui/styles";
import AccountCircleIcon from '@material-ui/icons/AccountCircle';

const useStyles = makeStyles((theme) => ({
  avatar: {
    '&:hover':{
      backgroundColor: "grey"
    }
  }
}))

function Profile() {
  const classes = useStyles();

  const initials =  localStorage.getItem("name").match(/(\b\S)?/g).join("").toUpperCase();
  
  return(
    <div style={{marginTop:"10px", marginBottom:"10px", marginLeft:"auto", marginRight:"10px"}}>
      <Button>
        <Avatar className={classes.avatar} src={initials ? null : AccountCircleIcon}>{initials}</Avatar>
      </Button>
    </div>
  );
}

export default Profile;
